export default function ResultsCard({ result }) {
  const { verdict, score, modules } = result;

  return (
    <div className="bg-white shadow-lg rounded-xl p-6">
      <h2 className="text-xl font-semibold text-indigo-700 mb-2">
        Verdict: <span className="text-gray-900">{verdict.toUpperCase()}</span>
      </h2>
      <p className="text-gray-600 mb-4">Score: {score}</p>
      <div className="space-y-2">
        {Object.entries(modules).map(([key, value]) => (
          <div key={key} className="border p-3 rounded-lg bg-gray-50">
            <strong className="capitalize">{key.replace('_', ' ')}:</strong>
            <pre className="whitespace-pre-wrap text-sm text-gray-700">{JSON.stringify(value, null, 2)}</pre>
          </div>
        ))}
      </div>
    </div>
  );
}
